"use strict";(self.webpackChunkblog_web=self.webpackChunkblog_web||[]).push([[1477],{10:function(n){n.exports=JSON.parse('{"blogPosts":[{"id":"build-docker-image-in-docker-with-gitlab-ci.html","metadata":{"permalink":"/blog/build-docker-image-in-docker-with-gitlab-ci.html","editUrl":"https://github.com/facebook/docusaurus/edit/master/website/blog/blog/2021-01-01-build-docker-image-docker-with-gitlab-ci.md","source":"@site/blog/2021-01-01-build-docker-image-docker-with-gitlab-ci.md","title":"\u901a\u8fc7Gitlab CI\u6784\u5efaDocker\u955c\u50cf","description":"\u524d\u60c5\u63d0\u8981","date":"2021-01-01T00:00:00.000Z","formattedDate":"2021\u5e741\u67081\u65e5","tags":[{"label":"Docker","permalink":"/blog/tags/docker"},{"label":"Gitlab CI","permalink":"/blog/tags/gitlab-ci"},{"label":"dind","permalink":"/blog/tags/dind"},{"label":"Docker Image","permalink":"/blog/tags/docker-image"}],"readingTime":1.64,"truncated":false,"authors":[{"name":"losgif","title":"\u524d\u7aef\u5f00\u53d1\u8005","url":"https://github.com/losgif","imageURL":"https://avatars.githubusercontent.com/u/13404752?v=4"}],"nextItem":{"title":"JavaScript \u4e2d\u7684\u9632\u6296\u548c\u8282\u6d41","permalink":"/blog/debounce-and-throttle.html"}},"content":"## \u524d\u60c5\u63d0\u8981\\nGitlab CI \u73af\u5883\u4e00\u822c\u6709\uff1adocker, shell\u3002\u672c\u6587\u8ba8\u8bba\u5728docker\u8fd0\u884c\u73af\u5883\u4e2d\u5982\u4f55\u518d\u6b21\u6784\u5efaDocker\u955c\u50cf\u3002  \\n\u6709\u70b9\u5148\u6709\u9e21\u8fd8\u662f\u5148\u6709\u86cb\u7684\u610f\u601d\uff0c\u6240\u4ee5docker\u7684\u89e3\u51b3\u65b9\u6848\u662f`dind`\u3002\\n\\n> `dind` \u6307\u7684\u662f Docker in Docker\uff0c\u4e00\u79cd\u5728docker\u5bb9\u5668\u5185\u4f7f\u7528docker\u7684\u65b9\u6cd5\\n\\n## \u6784\u5efa\\n\u9996\u5148\u770b\u4e0b\u6587\u4ef6\u7ed3\u6784\\n```shell\\n$ tree     \\n.\\n\u251c\u2500\u2500 .gitlab-ci.yml\\n\u2514\u2500\u2500 Dockerfile\\n\\n0 directories, 3 files\\n\\n```\\n\\n### Dockerfile\\n\u4e0d\u5fc5\u591a\u8bf4\uff0cdocker\u6784\u5efa\u955c\u50cf\u5fc5\u5907\u6587\u4ef6\\n\\n### .gitlab-ci.yml\\ngitlab ci \u914d\u7f6e\u6587\u4ef6\\n\\n\u76f4\u63a5\u770b\u4e0b\u914d\u7f6e\u6587\u4ef6\\n\\n```dockerfile\\n# This file is a template, and might need editing before it works on your project.\\nbuild:\\n  tags:\\n    - docker-ci-runner\\n  # Official docker image.\\n  image: docker:latest\\n  services:\\n    - docker:dind\\n  before_script:\\n    - docker login -u \\"$CI_REGISTRY_USER\\" -p \\"$CI_REGISTRY_PASSWORD\\" $CI_REGISTRY\\n  script:\\n    - docker build --tag \\"$CI_REGISTRY_IMAGE:$CI_COMMIT_TAG\\" .\\n    - docker push \\"$CI_REGISTRY_IMAGE:$CI_COMMIT_TAG\\"\\n  only:\\n    # \u4ec5\u8fd0\u884c\u5728\u6dfb\u52a0\u6807\u7b7e\u65f6\\n    - tags\\n\\n```\\n\u524d\u7f6e\u77e5\u8bc6\u9700\u8981\u4e86\u89e3 .gitlab-ci.yml \u914d\u7f6e  \\n\u6587\u6863\u53ef\u4ee5\u67e5\u770b[\u8fd9\u91cc](https://docs.gitlab.com/ee/ci/yaml/index.html)  \\n\u5185\u5bb9\u5f88\u7b80\u5355\uff0c\u58f0\u660eimage\u3001tags\u3001script\u3001only\u3001services  \\n\u4e3b\u8981\u5173\u6ce8services\u5185\u58f0\u660e\u4f7f\u7528\u4e86docker:dind\uff0c\u501f\u6b64\u53ef\u4ee5\u5b8c\u6210docker\u5bb9\u5668 \u5185\u6784\u5efadocker \u955c\u50cf\u3002\\n\\n```shell\\ndocker build --tag \\"$CI_REGISTRY_IMAGE:$CI_COMMIT_TAG\\" .\\n```\\n\u6b64\u547d\u4ee4\u5b8c\u6210\u4e86\u6784\u5efa\u955c\u50cf\u4efb\u52a1\uff0c\u4e14\u4f7f\u7528git\u6807\u7b7e\u540d\u4f5c\u4e3a\u955c\u50cf\u6807\u7b7e\u3002\\n\\n## \u63a8\u9001\\n```shell\\ndocker push \\"$CI_REGISTRY_IMAGE:$CI_COMMIT_TAG\\"\\n```\\nGitlab CE\u7248\u672c\u4e5f\u662f\u652f\u6301docker\u955c\u50cf\u5e93\u7684\uff0c\u4e0a\u9762\u7684\u914d\u7f6e\u53ef\u4ee5\u5b8c\u6210\u63a8\u9001\u81f3\u955c\u50cf\u5e93\u3002  \\n\u81f3\u6b64\u5b8c\u6210\u4e86\u955c\u50cf\u6784\u5efa\u548c\u63a8\u9001\u3002"},{"id":"debounce-and-throttle.html","metadata":{"permalink":"/blog/debounce-and-throttle.html","editUrl":"https://github.com/facebook/docusaurus/edit/master/website/blog/blog/2020-04-20-debounce-and-throttle.md","source":"@site/blog/2020-04-20-debounce-and-throttle.md","title":"JavaScript \u4e2d\u7684\u9632\u6296\u548c\u8282\u6d41","description":"\u4f7f\u7528\u573a\u666f","date":"2020-04-20T00:00:00.000Z","formattedDate":"2020\u5e744\u670820\u65e5","tags":[{"label":"\u6559\u7a0b","permalink":"/blog/tags/\u6559\u7a0b"},{"label":"\u8282\u6d41\u548c\u9632\u6296","permalink":"/blog/tags/\u8282\u6d41\u548c\u9632\u6296"},{"label":"JavaScript","permalink":"/blog/tags/java-script"}],"readingTime":4.7,"truncated":false,"authors":[{"name":"losgif","title":"\u524d\u7aef\u5f00\u53d1\u8005","url":"https://github.com/losgif","imageURL":"https://avatars.githubusercontent.com/u/13404752?v=4"}],"prevItem":{"title":"\u901a\u8fc7Gitlab CI\u6784\u5efaDocker\u955c\u50cf","permalink":"/blog/build-docker-image-in-docker-with-gitlab-ci.html"},"nextItem":{"title":"Vue 2 \u5347\u7ea7 TypeScript \u7b80\u5355\u98df\u7528\u65b9\u5f0f","permalink":"/blog/vuejs2-typescript.html"}},"content":"## \u4f7f\u7528\u573a\u666f\\n\\n\u5728\u8fdb\u884c\u7a97\u53e3\u7684resize\u3001scroll\uff0c\u8f93\u5165\u6846\u5185\u5bb9\u6821\u9a8c\u7b49\u64cd\u4f5c\u65f6\uff0c\u5982\u679c\u4e8b\u4ef6\u5904\u7406\u51fd\u6570\u8c03\u7528\u7684\u9891\u7387\u65e0\u9650\u5236\uff0c\u4f1a\u52a0\u91cd\u6d4f\u89c8\u5668\u7684\u8d1f\u62c5\uff0c\u5bfc\u81f4\u7528\u6237\u4f53\u9a8c\u975e\u5e38\u7cdf\u7cd5\u3002  \\n\u6b64\u65f6\u6211\u4eec\u53ef\u4ee5\u91c7\u7528debounce\uff08\u9632\u6296\uff09\u548cthrottle\uff08\u8282\u6d41\uff09\u7684\u65b9\u5f0f\u6765\u51cf\u5c11\u8c03\u7528\u9891\u7387\uff0c\u540c\u65f6\u53c8\u4e0d\u5f71\u54cd\u5b9e\u9645\u6548\u679c\u3002\\n\\n## \u540d\u8bcd\u89e3\u91ca\\n\\n### \u9632\u6296\u51fd\u6570\\n\\n\u9632\u6296\uff08debounce\uff09\uff1a\u5f53\u6301\u7eed\u89e6\u53d1\u4e8b\u4ef6\u65f6\uff0c\u4e00\u5b9a\u65f6\u95f4\u6bb5\u5185\u6ca1\u6709\u518d\u89e6\u53d1\u4e8b\u4ef6\uff0c  \\n\u4e8b\u4ef6\u5904\u7406\u51fd\u6570\u624d\u4f1a\u6267\u884c\u4e00\u6b21\uff0c\u5982\u679c\u8bbe\u5b9a\u7684\u65f6\u95f4\u5230\u6765\u4e4b\u524d\uff0c\u53c8\u4e00\u6b21\u89e6\u53d1\u4e86\u4e8b\u4ef6\uff0c\u5c31\u91cd\u65b0\u5f00\u59cb\u5ef6\u65f6\u3002  \\n\u5982\u4e0b\u56fe\uff0c\u6301\u7eed\u89e6\u53d1scroll\u4e8b\u4ef6\u65f6\uff0c\u5e76\u4e0d\u6267\u884chandle\u51fd\u6570\uff0c\u5f531000\u6beb\u79d2\u5185\u6ca1\u6709\u89e6\u53d1scroll\u4e8b\u4ef6\u65f6\uff0c\u624d\u4f1a\u5ef6\u65f6\u89e6\u53d1scroll\u4e8b\u4ef6\u3002\\n\\n![debounce.png](https://res-static.hc-cdn.cn/fms/img/6862e0a0a403e16445761f89e2966fb71603448561229)\\n\\n### \u8282\u6d41\u51fd\u6570\\n\\n\u8282\u6d41\uff08throttle\uff09\uff1a\u5f53\u6301\u7eed\u89e6\u53d1\u4e8b\u4ef6\u65f6\uff0c\u4fdd\u8bc1\u4e00\u5b9a\u65f6\u95f4\u6bb5\u5185\u53ea\u8c03\u7528\u4e00\u6b21\u4e8b\u4ef6\u5904\u7406\u51fd\u6570\u3002  \\n\u8282\u6d41\u901a\u4fd7\u89e3\u91ca\u5c31\u6bd4\u5982\u6211\u4eec\u6c34\u9f99\u5934\u653e\u6c34\uff0c\u9600\u95e8\u4e00\u6253\u5f00\uff0c\u6c34\u54d7\u54d7\u7684\u5f80\u4e0b\u6d41\uff0c\u79c9\u7740\u52e4\u4fed\u8282\u7ea6\u7684\u4f18\u826f\u4f20\u7edf\u7f8e\u5fb7\uff0c\u6211\u4eec\u8981\u628a\u6c34\u9f99\u5934\u5173\u5c0f\u70b9\uff0c\u6700\u597d\u662f\u5982\u6211\u4eec\u5fc3\u610f\u6309\u7167\u4e00\u5b9a\u89c4\u5f8b\u5728\u67d0\u4e2a\u65f6\u95f4\u95f4\u9694\u5185\u4e00\u6ef4\u4e00\u6ef4\u7684\u5f80\u4e0b\u6ef4\u3002  \\n\u5982\u4e0b\u56fe\uff0c\u6301\u7eed\u89e6\u53d1scroll\u4e8b\u4ef6\u65f6\uff0c\u5e76\u4e0d\u7acb\u5373\u6267\u884chandle\u51fd\u6570\uff0c\u6bcf\u96941000\u6beb\u79d2\u624d\u4f1a\u6267\u884c\u4e00\u6b21handle\u51fd\u6570\u3002\\n![throttle.png](https://res-static.hc-cdn.cn/fms/img/3d0c29700d9a89ef7d33a2d7ac2e9fb31603448561230)\\n\\n## \u4ee3\u7801\u5b9e\u73b0\\n\\n### \u9632\u6296\uff1a\\n\\n```ts\\n// \u9632\u6296\\nfunction debounce (fn: Function, wait) {\\n  var timeout = null;\\n  return function () {\\n    if (timeout !== null) {\\n      clearTimeout(timeout);\\n    }\\n\\n    timeout = setTimeout(fn, wait);\\n  }\\n}\\n\\n// \u5904\u7406\u51fd\u6570\\nfunction handle () {\\n  console.log(Math.random());\\n}\\n\\n// \u6eda\u52a8\u4e8b\u4ef6\\nwindow.addEventListener(\'scroll\', debounce(handle, 1000));\\n```\\n\\n\u5f53\u6301\u7eed\u89e6\u53d1scroll\u4e8b\u4ef6\u65f6\uff0c\u4e8b\u4ef6\u5904\u7406\u51fd\u6570handle\u53ea\u5728\u505c\u6b62\u6eda\u52a81000\u6beb\u79d2\u4e4b\u540e\u624d\u4f1a\u8c03\u7528\u4e00\u6b21\u3002  \\n\u4e5f\u5c31\u662f\u8bf4\u5728\u6301\u7eed\u89e6\u53d1scroll\u4e8b\u4ef6\u7684\u8fc7\u7a0b\u4e2d\uff0c\u4e8b\u4ef6\u5904\u7406\u51fd\u6570handle\u4e00\u76f4\u6ca1\u6709\u6267\u884c\u3002\\n\\n### \u8282\u6d41\\n```ts\\nvar throttle = function (func, delay) {\\n  var timer = null;\\n  return function () {\\n    var context = this;\\n    var args = arguments;\\n\\n    if (!timer) {\\n      timer = setTimeout(function () {\\n        func.call(context, args);\\n        timer = null;\\n      }, delay);\\n    }\\n  }\\n}\\n\\nfunction handle () {\\n  console.log(Math.random());\\n}\\n\\nwindow.addEventListener(\'scroll\', throttle(handle, 1000));\\n```\\n\\n\u5f53\u89e6\u53d1\u4e8b\u4ef6\u7684\u65f6\u5019\uff0c\u6211\u4eec\u8bbe\u7f6e\u4e00\u4e2a\u5b9a\u65f6\u5668\uff0c\u518d\u6b21\u89e6\u53d1\u4e8b\u4ef6\u7684\u65f6\u5019\uff0c\u5982\u679c\u5b9a\u65f6\u5668\u5b58\u5728\uff0c\u5c31\u4e0d\u6267\u884c\uff0c\u76f4\u5230delay\u65f6\u95f4\u540e\uff0c\u5b9a\u65f6\u5668\u6267\u884c\u6267\u884c\u51fd\u6570\uff0c\u5e76\u4e14\u6e05\u7a7a\u5b9a\u65f6\u5668\uff0c\u8fd9\u6837\u5c31\u53ef\u4ee5\u8bbe\u7f6e\u4e0b\u4e2a\u5b9a\u65f6\u5668\u3002\u5f53\u7b2c\u4e00\u6b21\u89e6\u53d1\u4e8b\u4ef6\u65f6\uff0c\u4e0d\u4f1a\u7acb\u5373\u6267\u884c\u51fd\u6570\uff0c\u800c\u662f\u5728delay\u79d2\u540e\u624d\u6267\u884c\u3002\u800c\u540e\u518d\u600e\u4e48\u9891\u7e41\u89e6\u53d1\u4e8b\u4ef6\uff0c\u4e5f\u90fd\u662f\u6bcfdelay\u65f6\u95f4\u624d\u6267\u884c\u4e00\u6b21\u3002\u5f53\u6700\u540e\u4e00\u6b21\u505c\u6b62\u89e6\u53d1\u540e\uff0c\u7531\u4e8e\u5b9a\u65f6\u5668\u7684delay\u5ef6\u8fdf\uff0c\u53ef\u80fd\u8fd8\u4f1a\u6267\u884c\u4e00\u6b21\u51fd\u6570\u3002\\n\\n## \u603b\u7ed3\\n\\n### \u9632\u6296\uff1a\\n\u5c06\u51e0\u6b21\u64cd\u4f5c\u5408\u5e76\u4e3a\u4e00\u6b64\u64cd\u4f5c\u8fdb\u884c\u3002\u539f\u7406\u662f\u7ef4\u62a4\u4e00\u4e2a\u8ba1\u65f6\u5668\uff0c\u89c4\u5b9a\u5728delay\u65f6\u95f4\u540e\u89e6\u53d1\u51fd\u6570\uff0c\u4f46\u662f\u5728delay\u65f6\u95f4\u5185\u518d\u6b21\u89e6\u53d1\u7684\u8bdd\uff0c\u5c31\u4f1a\u53d6\u6d88\u4e4b\u524d\u7684\u8ba1\u65f6\u5668\u800c\u91cd\u65b0\u8bbe\u7f6e\u3002\u8fd9\u6837\u4e00\u6765\uff0c\u53ea\u6709\u6700\u540e\u4e00\u6b21\u64cd\u4f5c\u80fd\u88ab\u89e6\u53d1\u3002\\n\\n### \u8282\u6d41\uff1a\\n\u4f7f\u5f97\u4e00\u5b9a\u65f6\u95f4\u5185\u53ea\u89e6\u53d1\u4e00\u6b21\u51fd\u6570\u3002\u539f\u7406\u662f\u901a\u8fc7\u5224\u65ad\u662f\u5426\u5230\u8fbe\u4e00\u5b9a\u65f6\u95f4\u6765\u89e6\u53d1\u51fd\u6570\u3002\\n\\n### \u533a\u522b\uff1a \\n\u51fd\u6570\u8282\u6d41\u4e0d\u7ba1\u4e8b\u4ef6\u89e6\u53d1\u6709\u591a\u9891\u7e41\uff0c\u90fd\u4f1a\u4fdd\u8bc1\u5728\u89c4\u5b9a\u65f6\u95f4\u5185\u4e00\u5b9a\u4f1a\u6267\u884c\u4e00\u6b21\u771f\u6b63\u7684\u4e8b\u4ef6\u5904\u7406\u51fd\u6570\uff0c\u800c\u51fd\u6570\u9632\u6296\u53ea\u662f\u5728\u6700\u540e\u4e00\u6b21\u4e8b\u4ef6\u540e\u624d\u89e6\u53d1\u4e00\u6b21\u51fd\u6570\u3002 \u6bd4\u5982\u5728\u9875\u9762\u7684\u65e0\u9650\u52a0\u8f7d\u573a\u666f\u4e0b\uff0c\u6211\u4eec\u9700\u8981\u7528\u6237\u5728\u6eda\u52a8\u9875\u9762\u65f6\uff0c\u6bcf\u9694\u4e00\u6bb5\u65f6\u95f4\u53d1\u4e00\u6b21 Ajax \u8bf7\u6c42\uff0c\u800c\u4e0d\u662f\u5728\u7528\u6237\u505c\u4e0b\u6eda\u52a8\u9875\u9762\u64cd\u4f5c\u65f6\u624d\u53bb\u8bf7\u6c42\u6570\u636e\u3002\u8fd9\u6837\u7684\u573a\u666f\uff0c\u5c31\u9002\u5408\u7528\u8282\u6d41\u6280\u672f\u6765\u5b9e\u73b0\u3002\\n\\n## \u53c2\u8003\\n[https://www.lodashjs.com/docs/lodash.debounce](https://www.lodashjs.com/docs/lodash.debounce)\\n[https://www.huaweicloud.com/articles/d3842d8455d26db6868c19c7daced54b.html](https://www.huaweicloud.com/articles/d3842d8455d26db6868c19c7daced54b.html)\\n[https://dev.to/heymarkkop/debounce-x-throttle-23k5](https://dev.to/heymarkkop/debounce-x-throttle-23k5)"},{"id":"vuejs2-typescript.html","metadata":{"permalink":"/blog/vuejs2-typescript.html","editUrl":"https://github.com/facebook/docusaurus/edit/master/website/blog/blog/2019-05-30-vuejs2-typescript copy.md","source":"@site/blog/2019-05-30-vuejs2-typescript copy.md","title":"Vue 2 \u5347\u7ea7 TypeScript \u7b80\u5355\u98df\u7528\u65b9\u5f0f","description":"\u4e3a\u4ec0\u4e48\uff1f","date":"2019-05-30T00:00:00.000Z","formattedDate":"2019\u5e745\u670830\u65e5","tags":[{"label":"\u6559\u7a0b","permalink":"/blog/tags/\u6559\u7a0b"},{"label":"Vue","permalink":"/blog/tags/vue"},{"label":"TypeScript","permalink":"/blog/tags/type-script"}],"readingTime":4.4,"truncated":false,"authors":[{"name":"losgif","title":"\u524d\u7aef\u5f00\u53d1\u8005","url":"https://github.com/losgif","imageURL":"https://avatars.githubusercontent.com/u/13404752?v=4"}],"prevItem":{"title":"JavaScript \u4e2d\u7684\u9632\u6296\u548c\u8282\u6d41","permalink":"/blog/debounce-and-throttle.html"},"nextItem":{"title":"GitHub Actions \u53ca GitHub Pages \u7b80\u5355\u642d\u914d","permalink":"/blog/github-action.html"}},"content":"## \u4e3a\u4ec0\u4e48\uff1f\\n\\n\u5f15\u8a00\uff1a\\n~~Vue 3 \u90fd\u62e5\u62b1 TypeScript \u4e86\uff0c\u4f60\u8bf4\u5462\uff1f\\\\[\u72d7\u5934]~~\\n\\n\u968f\u7740\u5e94\u7528\u7684\u589e\u957f\uff0c\u9759\u6001\u7c7b\u578b\u7cfb\u7edf\u53ef\u4ee5\u5e2e\u52a9\u9632\u6b62\u8bb8\u591a\u6f5c\u5728\u7684\u8fd0\u884c\u65f6\u9519\u8bef\uff0c\u8fd9\u5c31\u662f\u4e3a\u4ec0\u4e48 Vue 3 \u662f\u7528 TypeScript \u7f16\u5199\u7684\u3002\u8fd9\u610f\u5473\u7740\u5728 Vue \u4e2d\u4f7f\u7528 TypeScript \u4e0d\u9700\u8981\u4efb\u4f55\u5176\u4ed6\u5de5\u5177\u2014\u2014\u5b83\u5177\u6709\u4e00\u6d41\u7684\u516c\u6c11\u652f\u6301\u3002\\n\\n## \u5982\u4f55\u64cd\u4f5c\\n\\nVue 3 \u4f7f\u7528 TypeScript \u5f88\u7b80\u5355\uff0cCLI \u521b\u5efa\u9879\u76ee\u65f6\u9009\u53d6\u4e0b\u5373\u53ef  \\n\u5df2\u6709Vue2\u9879\u76ee\u4e0d\u914d\u5417?  \\n\u5f53\u7136\u4e0d\u662f\uff0cVue \u5b98\u65b9\u901a\u8fc7 ts \u7684 d.ts \u6587\u4ef6\u7533\u660e\u4e86Vue 2\u7684\u9759\u6001\u7c7b\u578b  \\n\u4e5f\u5b9e\u73b0\u4e86Vue 2\u4f7f\u7528 TypeScript \u7684\u613f\u671b\\n\\n### \u6dfb\u52a0 TypeScript \u652f\u6301\\n\\n#### \u5b89\u88c5 NPM \u5305\\n```shell\\nnpm install -D typescript\\n```\\n\\n#### \u914d\u7f6e typconfig.json \u6587\u4ef6\\n\\n```json\\n// tsconfig.json\\n{\\n  \\"compilerOptions\\": {\\n    // \u4e0e Vue \u7684\u6d4f\u89c8\u5668\u652f\u6301\u4fdd\u6301\u4e00\u81f4\\n    \\"target\\": \\"es5\\",\\n    // \u8fd9\u53ef\u4ee5\u5bf9 `this` \u4e0a\u7684\u6570\u636e property \u8fdb\u884c\u66f4\u4e25\u683c\u7684\u63a8\u65ad\\n    \\"strict\\": true,\\n    // \u5982\u679c\u4f7f\u7528 webpack 2+ \u6216 rollup\uff0c\u53ef\u4ee5\u5229\u7528 tree-shake:\\n    \\"module\\": \\"es2015\\",\\n    \\"moduleResolution\\": \\"node\\"\\n  }\\n}\\n```\\n\\n\u5b89\u88c5\u5de5\u4f5c\u5230\u6b64\u5df2\u7ecf\u5b8c\u6210\\n\\n### \u57fa\u672c\u7528\u6cd5\\n\\n\u4e4b\u524d\u76f4\u63a5\u4f7f\u7528\u5bf9\u8c61\u5b9a\u4e49\u7ec4\u4ef6\u7684\u65b9\u5f0f\u884c\u4e0d\u901a\u4e86  \\n\u8981\u8ba9 TypeScript \u6b63\u786e\u63a8\u65ad Vue \u7ec4\u4ef6\u9009\u9879\u4e2d\u7684\u7c7b\u578b  \\n\u60a8\u9700\u8981\u4f7f\u7528 Vue.component \u6216 Vue.extend \u5b9a\u4e49\u7ec4\u4ef6  \\n\\n```ts\\nimport Vue from \'vue\'\\nconst RightComponent = Vue.extend({\\n  // \u7c7b\u578b\u63a8\u65ad\u5df2\u542f\u7528\\n})\\n\\nconst ErrorComponent = {\\n  // \u8fd9\u91cc\u4e0d\u4f1a\u6709\u7c7b\u578b\u63a8\u65ad\uff0c\\n  // \u56e0\u4e3a TypeScript \u4e0d\u80fd\u786e\u8ba4\u8fd9\u662f Vue \u7ec4\u4ef6\u7684\u9009\u9879\\n}\\n```\\n\\n### \u9ad8\u7ea7\u7528\u6cd5\\n\\n\u8bf7\u53c2\u89c1 [VueJS \u5b98\u65b9\u6587\u6863](https://cn.vuejs.org/v2/guide/typescript.html#%E5%A2%9E%E5%BC%BA%E7%B1%BB%E5%9E%8B%E4%BB%A5%E9%85%8D%E5%90%88%E6%8F%92%E4%BB%B6%E4%BD%BF%E7%94%A8)\\n\\n\\n### \u57fa\u4e8e\u7c7b\u7684 Vue \u7ec4\u4ef6\\n\\n\u5982\u679c\u4f60\u8bf4\u6211\u4e0d\u559c\u6b22 `Vue.extend` \u6216 `Vue.component` \u5b9a\u4e49\u51fa\u6765\u7684\u7ec4\u4ef6\uff0c\u60f3\u4f7f\u7528 Class \u5b9a\u4e49  \\n\u4e5f\u662f\u53ef\u4ee5\u7684\\n\\n\u53ef\u4ee5\u4f7f\u7528\u5b98\u65b9\u7ef4\u62a4\u7684 [vue-class-component](https://github.com/vuejs/vue-class-component) \u88c5\u9970\u5668:\\n\\n```ts\\nimport Vue from \'vue\'\\nimport Component from \'vue-class-component\'\\n\\n// @Component \u4fee\u9970\u7b26\u6ce8\u660e\u4e86\u6b64\u7c7b\u4e3a\u4e00\u4e2a Vue \u7ec4\u4ef6\\n@Component({\\n  // \u6240\u6709\u7684\u7ec4\u4ef6\u9009\u9879\u90fd\u53ef\u4ee5\u653e\u5728\u8fd9\u91cc\\n  template: \'<button @click=\\"onClick\\">Click!</button>\'\\n})\\nexport default class MyComponent extends Vue {\\n  // \u521d\u59cb\u6570\u636e\u53ef\u4ee5\u76f4\u63a5\u58f0\u660e\u4e3a\u5b9e\u4f8b\u7684 property\\n  message: string = \'Hello!\'\\n\\n  // \u7ec4\u4ef6\u65b9\u6cd5\u4e5f\u53ef\u4ee5\u76f4\u63a5\u58f0\u660e\u4e3a\u5b9e\u4f8b\u7684\u65b9\u6cd5\\n  onClick (): void {\\n    window.alert(this.message)\\n  }\\n}\\n```\\n\\n#### \u4e0e TSX \u642d\u914d\u4f7f\u7528\\n\\n\u65e2\u7136\u90fd\u7528\u4e0a\u4e86 Class \u7ec4\u4ef6\uff0c\u5e72\u8106\u518d \\"React\\" \u70b9\uff0c\u6765\u4eba\uff0c\u4e0a `TSX`\\n\\n```tsx\\nimport AnchoredHeading from \'./AnchoredHeading.vue\'\\n\\nnew Vue({\\n  el: \'#demo\',\\n  render: function (h) {\\n    return (\\n      <AnchoredHeading level={1}>\\n        <span>Hello</span> world!\\n      </AnchoredHeading>\\n    )\\n  }\\n})\\n```\\n\\n## \u7ec4\u4ef6\u5b9a\u4e49\u65b9\u5f0f\\n\\n### Vue2 + JS\\n#### \u65b9\u6cd5\u4e00\uff1a\u4f7f\u7528\u5bf9\u8c61\u5b9a\u4e49\\n```js\\nexport default {\\n  // type inference disabled\\n}\\n```\\n#### \u65b9\u6cd5\u4e8c\uff1a\u4f7f\u7528 Composition API \u65b9\u5f0f\u5b9a\u4e49\\n\u6b64\u65b9\u5f0f\u53ef\u4ee5\u5927\u90e8\u5206\u517c\u5bb9 Vue3 \u5199\u6cd5\uff0c\u5347\u7ea7Vue3\u65f6\u53ea\u9700\u8981\u4fee\u6539\u5bfc\u5165\u5373\u53ef\\n```js\\nimport { defineComponent } from \'@vue/composition-api\'\\n\\nexport default defineComponent({\\n  // type inference disabled\\n})\\n```\\n\\n### Vue3 + JS\\n\u4e0e Vue2 + JS \u65b9\u6cd5\u4e8c \u57fa\u672c\u4e00\u81f4\uff0c\u5bfc\u5165\u5dee\u5f02\u7f62\u4e86\\n```ts\\nimport { defineComponent } from \'vue\'\\n\\nexport default defineComponent({\\n  // type inference disabled\\n})\\n```\\n\\n### Vue2 + TS\\n#### \u65b9\u6cd5\u4e00: \u4f7f\u7528 Vue.extend \u5b9a\u4e49\\n\u57fa\u672c\u517c\u5bb9Vue2\u5bf9\u8c61\u5b9a\u4e49\u5199\u6cd5  \\n\\n:::danger  \\n\u6ce8\u610f `$ref` \u4e0d\u517c\u5bb9  \\n:::  \\n\\n```ts\\nimport { Vue } from \'vue-property-decorator\'\\n\\nexport default Vue.extend({\\n  // type inference enabled\\n})\\n```\\n\\n#### \u65b9\u6cd5\u4e8c\uff1a\u4f7f\u7528 Vue.component \u5b9a\u4e49\\n\u540c\u4e0a\\n```ts\\nimport { Vue } from \'vue-property-decorator\'\\n\\nexport default Vue.component({\\n  // type inference enabled\\n})\\n```\\n\\n#### \u65b9\u6cd5\u4e09\\n\u51fa\u73b0\u4e86\uff0cReact \\"\u90aa\u6559\\" \u6210\u5458\\n```tsx\\n<template>\\n  <div>\\n    ...\\n  </div>\\n</template>\\n<script lang=\\"ts\\">\\nimport { Vue, Component } from \'vue-property-decorator\'\\n\\n@Component\\nexport default class App extends Vue ({\\n  // type inference enabled\\n})\\n<\/script>\\n```\\n\\n#### \u65b9\u6cd5\u56db\\n\u6d53\u539a\u5473\u9053\u7684 React \u5199\u6cd5\\n```tsx\\nimport { Vue, Component } from \'vue-property-decorator\'\\n\\n@Component\\nexport default class App extends Vue ({\\n  @Prop({\\n    type: String,\\n    required: true\\n  }) readonly msg!: string\\n  \\n  render () {\\n    return (\\n      <div>\\n        <div>\\n          { this.msg }\\n        </div>\\n        <input type=\\"text\\" v-model={this.msg}/>\\n      </div>\\n    )\\n  }\\n})\\n```\\n\\n## \u53c2\u8003\u6587\u732e\\n\\n[Vue.js \u5b98\u65b9\u6587\u6863](https://cn.vuejs.org/v2/guide/)  \\n[Vue Class Component \u5b98\u65b9\u6587\u6863](https://class-component.vuejs.org/)  \\n[Vue Composition Api \u5b98\u65b9\u6587\u6863](https://github.com/vuejs/composition-api)"},{"id":"github-action.html","metadata":{"permalink":"/blog/github-action.html","editUrl":"https://github.com/facebook/docusaurus/edit/master/website/blog/blog/2019-05-29-github-actions.md","source":"@site/blog/2019-05-29-github-actions.md","title":"GitHub Actions \u53ca GitHub Pages \u7b80\u5355\u642d\u914d","description":"\u4f18\u52bf","date":"2019-05-29T00:00:00.000Z","formattedDate":"2019\u5e745\u670829\u65e5","tags":[{"label":"GitHub Actions","permalink":"/blog/tags/git-hub-actions"},{"label":"CI CD","permalink":"/blog/tags/ci-cd"}],"readingTime":2.49,"truncated":false,"authors":[{"name":"losgif","title":"\u524d\u7aef\u5f00\u53d1\u8005","url":"https://github.com/losgif","imageURL":"https://avatars.githubusercontent.com/u/13404752?v=4"}],"prevItem":{"title":"Vue 2 \u5347\u7ea7 TypeScript \u7b80\u5355\u98df\u7528\u65b9\u5f0f","permalink":"/blog/vuejs2-typescript.html"},"nextItem":{"title":"async / await \u4f7f\u7528\u6ce8\u610f","permalink":"/blog/async-await.html"}},"content":"## \u4f18\u52bf\\n\u53ef\u4ee5\u5728\u4e00\u4e2a\u4ed3\u5e93\u6216\u8005\u591a\u4e2a\u4ed3\u5e93\u91cc\u4fdd\u5b58\u6e90\u7801\u53ca\u6784\u5efa\u540e\u7684\u9759\u6001\u6587\u4ef6\u4ea7\u7269\\n\u5168\u7a0b\u81ea\u52a8\u5316\u90e8\u7f72\uff0c\u65e0\u9700\u4eba\u5de5\u5e72\u9884\\nGitHub \u4ee3\u7801\u6258\u7ba1\uff0c\u4fdd\u8bc1\u4ee3\u7801\u5b89\u5168\u65e0\u865e\\n\\n## GitHub Actions \u662f\u4ec0\u4e48\uff1f\\nGitHub Actions \u662f\u7531 GitHub \u63a8\u51fa\u7684\u5305\u542b CI\u3001CD\u3001\u6784\u5efa\u3001\u6d4b\u8bd5\u53ca\u90e8\u7f72\u7684\u81ea\u52a8\u5316\u5de5\u4f5c\u6d41\\n\\n\u5b98\u65b9\u4ecb\u7ecd\u4e3a\uff1a\\n\\nGitHub Actions makes it easy to automate all your software workflows, now with world-class CI/CD. Build, test, and deploy your code right from GitHub. Make code reviews, branch management, and issue triaging work the way you want.\\n\\n## GitHub Pages \u662f\u4ec0\u4e48\uff1f\\nGitHub Pages \u662f\u7531 GitHub \u63a8\u51fa\u7684\u4e00\u9879\u9759\u6001\u9875\u9762\u6258\u7ba1\u670d\u52a1\uff0c\u53ef\u7528\u4ee5\u5c55\u793a\u9879\u76ee\u3001\u4e2a\u4eba\u3001\u7ec4\u7ec7\u7b49\u76f8\u5173\u9875\u9762\u3002\\n\\n\u5177\u4f53 Github Pages \u6b64\u5904\u4e0d\u505a\u8fc7\u591a\u8d58\u8ff0\uff0c\u8bf7\u81ea\u884c\u67e5\u9605\u8d44\u6599\\n\\n## \u7b80\u5355\u4f7f\u7528\\n\u501f\u7528 Actions \u7684\u5f3a\u5927\u53ef\u81ea\u5b9a\u4e49\u6027\u8d28\uff0c\u6211\u4eec\u53ef\u4ee5\u4f7f\u7528 GitHub Actions \u5b9e\u73b0\u5bf9 GitHub Pages \u7684\u81ea\u52a8\u5316\u90e8\u7f72\u3002\\n\\n### \u521b\u5efaGit\u4ed3\u5e93\u5e76\u5b89\u88c5\u535a\u5ba2\u7a0b\u5e8f\\n\u9996\u5148\u521b\u5efa\u4e00\u4e2a\u7528\u6765\u4fdd\u5b58\u9759\u6001\u9875\u9762\u7684\u4ed3\u5e93\uff0c\u8fd9\u91cc\u6211\u4eec\u4f7f\u7528\u7684\u9759\u6001\u9875\u9762\u751f\u6210\u5668\u662f Hexo \u535a\u5ba2\u6846\u67b6\\n\\n\u26a0\ufe0f\u6ce8\u610f\uff1a\u4ee3\u7801\u4ed3\u5e93\u91cc\u4fdd\u5b58\u7684\u662f\u535a\u5ba2\u7a0b\u5e8f\u7684\u6e90\u7801\uff0c\u65e0\u9700\u6267\u884c `hexo g` \u4e0a\u4f20 `public` \u6587\u4ef6\u5939\\n\\n### \u521b\u5efa GitHub Actions \u5de5\u4f5c\u6d41\u6587\u4ef6\\n\\n\u5728\u76ee\u5f55 `./github/workflows` \u4e0b\u521b\u5efa YAML \u6587\u4ef6\uff0c\u6587\u4ef6\u540d\u81ea\u53d6\uff0c\u5982 `deploy.yml`\\n\\n\u5185\u5bb9\u586b\u5145\u4e3a\\n```yaml\\nname: Deploy to GitHub Pages\\non:\\n  push:\\n    branches:\\n      - master # \u63a8\u9001\u6b64\u5206\u652f\u89e6\u53d1\u90e8\u7f72\u6d41\u7a0b\\n\\njobs:\\n  deploy:\\n    name: Deploy to GitHub Pages\\n    runs-on: ubuntu-latest\\n    steps:\\n      # \u68c0\u51fa\u4ee3\u7801\\n      - uses: actions/checkout@master\\n\\n      # \u8bbe\u7f6e Nodejs\\n      - uses: actions/setup-node@v2\\n        with:\\n          node-version: \'14\'\\n      - run: npm i -g hexo-cli\\n      - run: npm install\\n      - run: cd themes/obsidian && npm install\\n      - run: hexo g\\n\\n      # \u90e8\u7f72\u9759\u6001\u9875\u9762\\n      - name: Deploy\\n        uses: s0/git-publish-subdir-action@develop\\n        env:\\n          REPO: self\\n          BRANCH: gh-pages # Github Pages \u90e8\u7f72\u5206\u652f\\n          FOLDER: public/\\n          GITHUB_TOKEN: ${{ secrets.GITHUB_TOKEN }}\\n\\n```\\n\\n### \u63d0\u4ea4\u4ee3\u7801\u81f3 GitHub \u4ed3\u5e93\\nGitHub \u4ed3\u5e93\u4f1a\u81ea\u52a8\u8bc6\u522b\u5de5\u4f5c\u6d41\u6587\u4ef6\uff0c\u5e76\u4e14\u5728\u4f60\u6bcf\u6b21\u63d0\u4ea4\u65b0\u7684\u4ee3\u7801\u5230 master \u5206\u652f\u65f6\u5f00\u59cb\u6267\u884c\u4e00\u4e2a action\\n\u81f3\u6b64\uff0cGitHub Actions \u4e0e GitHub Pages \u7b80\u5355\u642d\u914d\u4f7f\u7528\u5df2\u7ed3\u675f\u3002"},{"id":"async-await.html","metadata":{"permalink":"/blog/async-await.html","editUrl":"https://github.com/facebook/docusaurus/edit/master/website/blog/blog/2019-05-28-async-await.md","source":"@site/blog/2019-05-28-async-await.md","title":"async / await \u4f7f\u7528\u6ce8\u610f","description":"js \u4e2d\u7684 async / await \u6709\u4f55\u4f5c\u7528\uff1f","date":"2019-05-28T00:00:00.000Z","formattedDate":"2019\u5e745\u670828\u65e5","tags":[{"label":"\u6559\u7a0b","permalink":"/blog/tags/\u6559\u7a0b"},{"label":"JavaScript","permalink":"/blog/tags/java-script"},{"label":"async/await","permalink":"/blog/tags/async-await"}],"readingTime":5.225,"truncated":false,"authors":[{"name":"losgif","title":"\u524d\u7aef\u5f00\u53d1\u8005","url":"https://github.com/losgif","imageURL":"https://avatars.githubusercontent.com/u/13404752?v=4"}],"prevItem":{"title":"GitHub Actions \u53ca GitHub Pages \u7b80\u5355\u642d\u914d","permalink":"/blog/github-action.html"}},"content":"## js \u4e2d\u7684 async / await \u6709\u4f55\u4f5c\u7528\uff1f\\n\u6709\u4e00\u79cd\u7279\u6b8a\u7684\u8bed\u6cd5\u53ef\u4ee5\u66f4\u8212\u9002\u5730\u4e0e`Promise`\u4e00\u8d77\u4f7f\u7528\uff0c\u79f0\u4e3a\u201c`async/await`\u201d\u3002\u5b83\u975e\u5e38\u5bb9\u6613\u7406\u89e3\u548c\u4f7f\u7528\u3002\\n\\n\u5199\u8fc7`JQuery`\u7684\u540c\u5b66\u5bf9\u4e8e\u5176\u4e2d\u7684\u56de\u8c03\u80af\u5b9a\u5370\u8c61\u6df1\u523b\uff0c\u5728\u591a\u5c42\u5d4c\u5957\u56de\u8c03\u4e2d\uff0c\u4ee3\u7801\u7ed3\u6784\u7b80\u76f4\u4e71\u5982\u9ebb\u3002\u4f17\u591a\u9971\u53d7\u5176\u837c\u6bd2\u7684\u53d7\u5bb3\u8005\u5bf9\u6b64\u8d77\u4e86\u4e00\u4e2a\u5f62\u8c61\u7684\u540d\u79f0\uff1a\u56de\u8c03\u5730\u72f1\u3002\\n\\n\u4e3a\u4e86\u89e3\u51b3\u6b64\u7c7b\u95ee\u9898\uff0cJS\u63d0\u4f9b\u4e86\u4e24\u4e2a\u65b0\u8bed\u6cd5\uff1a`Promise` \u548c `async / await`\uff0c\u5176\u4e2d `async / await` \u4e00\u822c\u914d\u5957\u4f7f\u7528\u3002 \\n\\n## async / await \u8bed\u6cd5\\n\\n```javascript\\nasync function name([param[, param[, ...param]]]) {\\n   statements\\n}\\n```\\n### \u53c2\u6570\\n* `name`\\n \u51fd\u6570\u540d\\n* `param`\\n \u5f62\u53c2\\n* `statements`\\n \u51fd\u6570\u4e3b\u4f53\u8bed\u53e5\uff0c\u5176\u4e2d `await` \u4e3a\u53ef\u9009\u4f7f\u7528\\n \\n### \u8fd4\u56de\u503c\\n\u8fd4\u56de\u4e00\u4e2a`Promise`\uff0c\u5b83\u5c06\u7531async\u51fd\u6570\u8fd4\u56de\u7684\u503c\u6765\u89e3\u51b3\uff0c\u6216\u8005\u88abasync\u51fd\u6570\u629b\u51fa\u6216\u672a\u6355\u83b7\u5230\u7684\u5f02\u5e38\u62d2\u7edd\u3002\\n\\n### \u793a\u4f8b\\n```javascript\\nfunction resolveAfter2Seconds() {\\n  return new Promise(resolve => {\\n    setTimeout(() => {\\n      resolve(\'resolved\');\\n    }, 2000);\\n  });\\n}\\n\\nasync function asyncCall() {\\n  console.log(\'calling\');\\n  const result = await resolveAfter2Seconds();\\n  console.log(result);\\n  // expected output: \\"resolved\\"\\n}\\n\\nasyncCall();\\n```\\n\\n## \u4f7f\u7528\u6ce8\u610f\\n### `async` \u51fd\u6570\u603b\u662f\u8fd4\u56de `Promise`\\n\u5373\u4f7f\u8fd4\u56de\u503c\u53ea\u662f\u4e00\u4e2a`primitive`\u503c\uff0c`async`\u51fd\u6570\u4e5f\u4f1a\u901a\u8fc7`return`\u81ea\u52a8\u5c06\u8fd4\u56de\u503c\u5305\u88c5\u6210\u4e00\u4e2a`Promise`\u5bf9\u8c61\u8fd4\u56de\u3002\\n\u56e0\u6b64\uff0c\u4e0b\u9762\u4e24\u7ec4\u51fd\u6570\u662f\u7b49\u4ef7\u7684\u3002\\n\\n#### \u6b63\u5e38 (Fulfill)\\n```javascript\\n// async\u51fd\u6570\\nasync function foo () {\\n  return \'a\'\\n}\\n\\n// Promise\\nfunction foo () {\\n  return Promise.resolve(\'a\')\\n}\\n```\\n\\n#### \u5f02\u5e38 (Reject)\\n```javascript\\n// async\u51fd\u6570\\nasync function foo () {\\n  throw new Error(\'error\')\\n}\\n\\n// Promise\\nfunction foo () {\\n  return Promise.reject(new Error(\'error\'))\\n}\\n```\\n\\n### `await`\u603b\u662f\u6309\u987a\u5e8f\u6267\u884c\\n\u4f7f\u7528`async`\u51fd\u6570\u4e4b\u524d\uff0c\u6211\u4eec\u8fd8\u5f97\u641e\u6e05\u695a\u5b83\u7684\u8fd0\u884c\u673a\u5236\u3002\u5c24\u5176\u662f\u5728\u6267\u884c\u987a\u5e8f\u4e0a\uff0c\u5b8c\u5168\u7528\u540c\u6b65\u7684\u601d\u7ef4\u4e5f\u8bb8\u5e76\u4e0d\u9002\u7528\u4e8e`async`\u51fd\u6570\u3002\\n\\n```javascript\\nfunction asyncGet (x) {\\n  return new Promise(resolve => setTimeout(() => {\\n    console.log(\'a\')\\n    resolve(x)\\n  }, 500))\\n}\\n\\nasync function test () {\\n  console.log(\'b\')\\n  const x = 3 + 5\\n  console.log(x)\\n\\n  const a = await asyncGet(1)\\n  console.log(a)\\n\\n  const b = await asyncGet(2)\\n  console.log(b)\\n\\n  console.log(\'c\')  \\n  return a + b\\n}\\n\\nconst now = Date.now()\\nconsole.log(\'d\')\\ntest().then(x => {\\n  console.log(x)\\n  console.log(`elapsed: ${Date.now() - now}`)\\n})\\nconsole.log(\'f\')\\n```\\n1. `async`\u51fd\u6570\u548c\u666e\u901a\u51fd\u6570\u4e00\u6837\u6309\u987a\u5e8f\u6267\u884c\uff0c\u540c\u65f6\uff0c\u5728\u6267\u884c\u5230`await`\u8bed\u53e5\u65f6\uff0c\u8fd4\u56de\u4e00\u4e2a`Promise`\u5bf9\u8c61\\n2. `await`\u53ef\u4ee5\u7406\u89e3\u4e3a\u5c06`async`\u51fd\u6570\u6302\u8d77\uff0c\u76f4\u5230\u7b49\u5f85\u7684`Promise`\u88ab`fulfill`\u6216\u8005`reject`\uff0c\u518d\u7ee7\u7eed\u6267\u884c\u4e4b\u540e\u7684\u4ee3\u7801 \\n3. `async`\u51fd\u6570\u7684\u8fd4\u56de\u503c\u548c\u666e\u901a`Promise`\u6ca1\u6709\u533a\u522b\\n\\n\u56e0\u6b64\uff0c\u4e0a\u9762\u4ee3\u7801\u8f93\u51fa\u5e94\u8be5\u662f\\n\\n```text\\nd\\nb\\n8\\nf\\na\\n1\\na\\n2\\nc\\n3\\nelapsed: 1010\\n```\\n> \u6ce8\u610f d \u548c f \u4e2d\u95f4\u7684\u8f93\u51fa\\n\\n\u8ba9\u6211\u4eec\u518d\u6765\u770b\u4e00\u4e2a\u6df7\u5408\u4e86`Promise`\u7684\u7248\u672c\u3002\\n\\n```javascript\\nfunction asyncGet (x) {\\n  return new Promise(resolve => setTimeout(() => {\\n    console.log(\'a\')\\n    resolve(x)\\n  }, 500))\\n}\\n\\nasync function test () {\\n  console.log(\'b\')\\n  const x = 3 + 5\\n  console.log(x)\\n\\n  const [a, b] = await Promise.all([\\n    asyncGet(1),\\n    asyncGet(2)\\n  ])\\n\\n  console.log(\'c\')  \\n  return a + b\\n}\\n\\nconst now = Date.now()\\nconsole.log(\'d\')\\ntest().then(x => {\\n  console.log(x)\\n  console.log(`elapsed: ${Date.now() - now}`)\\n})\\nconsole.log(\'f\')\\n```\\n\\n\u8f93\u51fa\u7ed3\u679c\\n\\n```text\\nd\\nb\\n8\\nf\\na\\na\\nc\\n3\\nelapsed: 509\\n```\\n\\n\u6ce8\u610f\u5230`elapsed`\u7684\u5dee\u522b\u4e86\u5417\uff1f\u8fd9\u5c31\u662f\u4e3a\u4ec0\u4e48\u6211\u4eec\u8bf4`await`\u603b\u662f\u987a\u5e8f\u6267\u884c\u7684\u3002\u4e0d\u540c\u7684`await`\u4e4b\u95f4\u65e0\u6cd5\u5e76\u884c\u6267\u884c\uff0c\u60f3\u8981\u771f\u6b63\u7684\u5b8c\u5168\u5f02\u6b65\u8fd8\u5f97\u501f\u52a9\u7c7b\u4f3c`Promise.all`\u8fd9\u6837\u7684\u65b9\u6cd5\u3002\\n\\n### `async` \u51fd\u6570\u548c `callback`\\n`await` \u53ea\u80fd\u80fd\u5f71\u54cd\u76f4\u63a5\u5305\u88f9\u5b83\u7684 `async` \u51fd\u6570\u3002\u56e0\u6b64\u5728 `callback` \u51fd\u6570\u4e2d\u7684 `await` \u5e76\u4e0d\u4f1a\u6302\u8d77\u6574\u4e2a `async` \u51fd\u6570\u7684\u6267\u884c\u3002\\n\\n\u4e00\u79cd\u5e38\u89c1\u7684\u9519\u8bef\\n\\n```javascript\\nasync function getAll (vals) {\\n  return vals.map(v => await asyncGet(v))\\n}\\n```\\n\u8fd9\u6bb5\u4ee3\u7801\u6709\u8bed\u6cd5\u9519\u8bef\uff0c`await` \u5e76\u4e0d\u5728 `async` \u51fd\u6570\u5185\u90e8\u3002\u5982\u679c\u7ed9 `map` \u7684 `callback` \u52a0\u4e0a `async` \u5462\uff1f\\n\\n```javascript\\nasync function getAll (vals) {\\n  return vals.map(async v => await asyncGet(v))\\n}\\n```\\n\\n\u8fd9\u6bb5\u4ee3\u7801\u867d\u7136\u80fd\u6267\u884c\uff0c\u4f46\u8fd8\u6709\u4e24\u4e2a\u95ee\u9898\u3002\\n\\n1. \u8fd4\u56de\u4e00\u4e2a`Promise`\u5bf9\u8c61\u7684\u6570\u7ec4\uff0c\u5e76\u4e0d\u662f\u6211\u4eec\u671f\u5f85\u7684`value`\u6570\u7ec4\\n2. await\u53ea\u4f1a\u6682\u505c`map`\u7684`callback`\uff0c\u56e0\u6b64`map`\u5b8c\u6210\u65f6\uff0c\u4e0d\u80fd\u4fdd\u8bc1`asyncGet`\u4e5f\u5168\u90e8\u5b8c\u6210   \\n\\n\u6b63\u786e\u7684\u5199\u6cd5\u8fd8\u5f97\u501f\u52a9 `Promise.all`\\n\\n```javascript\\nasync function getAll (vals) {\\n  return Promise.all(vals.map(v => asyncGet(v)))\\n}\\n```\\n\\n## \u603b\u7ed3\\n\u4ece\u4e0a\u6587\u6211\u4eec\u53ef\u4ee5\u770b\u51fa\uff0c`Promise` \u662f `async` \u51fd\u6570\u7684\u57fa\u7840\uff0c\u60f3\u8981\u6109\u5feb\u7684\u4f7f\u7528 `async` \u51fd\u6570\uff0c\u5fc5\u987b\u5bf9 `Promise` \u6709\u6bd4\u8f83\u6df1\u5165\u7684\u7406\u89e3\u3002\u751a\u81f3\u4e00\u4e9b\u5e38\u89c1\u7684\u4efb\u52a1\uff0c\u4ec5\u4ec5\u4f9d\u9760 `async` \u51fd\u6570\u65e0\u6cd5\u5b9e\u73b0\u3002\\n\u5e0c\u671b\u5927\u5bb6\u770b\u5b8c\u672c\u6587\u540e\u80fd\u5bf9 `async` \u51fd\u6570\u6709\u52a0\u66f4\u5168\u9762\u7684\u8ba4\u8bc6\uff0c\u8fd9\u6837\u4f7f\u7528\u8d77\u6765\u624d\u4f1a\u66f4\u52a0\u987a\u624b\u3002"}]}')}}]);